import React from 'react'
import TileGrid from 'components/tiles.d/tile-grid.component'
import {NullableEntityArray} from './country-search.component'

interface Props {
	results:NullableEntityArray
}
interface State {
	status:"waiting"|"loading"|"finished"
}

export default class CountryResults extends React.Component<Props,State> {


	constructor(props:Props){
		super(props);
		this.state={
			status:"waiting"
		};
	}


	render(){
		// switch(this.state.status){
		// case 'waiting':
		// 	return;
		// case 'loading':
		// 	return (<div className='loading'></div>)
		// case 'finished':
			return (
				<div id="output">
					{(!this.props.results||!this.props.results.length)
						? <div className='emptyResults'>No results</div>
						: <TileGrid content={this.props.results}/>
					}
				</div>
			)
		// }		
	}
}
